import ExpenseItem from './ExpenseItem';

function Expenses(props) {
    return (
        <div>
props.forEach(element => {
    <ExpenseItem title={element.title} amount={element.amount} date={element.date} curr={element.currency}></ExpenseItem>
});
        </div>
    );
}

export default Expenses;
